import React, {Component} from 'react';
import {Table, Button} from 'reactstrap';

 export default function ContactosList ({contactos}) {
    const emptyMessage = (
            <p>No hay contactos</p>
    );
    const contactosList = (
           <Fragment>
            <Table>
                <thead>
                    <tr>
                    <th>#</th>
                    <th>Nombre</th>
                    <th>Celular</th>
                    <th>Sexo</th>
                    <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {contactos.map(contacto => <tr key={contacto.Id}>
                        <td>{contacto.Id}</td>
                        <td>{contacto.Nombre}</td>
                        <td> {contacto.Celular}</td>
                        <td> {contacto.Sexo}</td>
                        <td>
                            <Button color="success" size="sm" className="mr-2" onClick={this.editarContacto.bind(this, contacto.Id, contacto.Nombre, contacto.Celular, contacto.Sexo)}>Editar</Button>
                            <Button color="danger" size="sm" onClick={this.eliminarContacto.bind(this,contacto.Id)}>Eliminar</Button>
                        </td>
                        </tr>)}
                </tbody>
                </Table>
            </Fragment>
    );

    return (
        <div>
            {contactos.length===0 ? emptyMessage : contactosList}
        </div>
    );
}
